import Layout from "../components/layout";
import Link from "next/link";

function PostLink(props) {
    <li>
        <Link href={`/post?title=${props.title}`}>
            <a>{props.title}</a>
        </Link>
    </li>
}

function Index() {    
    return (
        <Layout>
            <p>Hello Next.js</p>
        </Layout>
    )
}

export default Index;
